import React from 'react'
import { useHistory } from 'react-router'

export const RentBudgetFlat = (props) => {
    const history = useHistory()
    const rent_budget=()=>{
        history.push({
            pathname:"./propertylist",
            state:{
                reason:"Rent/ Lease",
                city:props.city,
                flat:"Flat/ Apartment",
                reason:"Rent/ Lease",

            }     

        })       }



    return (
         <div className="drop-links">
           <li><a href="" onClick={rent_budget}>Under 50lac</a></li>
         </div>
    )
}
